import mem1 from "../images/mem1.jpeg"
import { NavLink } from "react-router-dom";

const MEMS = [
    {
        title: "Mem 1",
        img: mem1,
    },
];

export const memList = () => {
    return (
      <div>
        Posts:
        <ul>
          {POSTS.map((post) => {
            return (
              <li key={post.id}>
                <NavLink to={`/posts/${post.id}`}>{post.title}</NavLink>
              </li>
            );
          })}
        </ul>
      </div>
    );
}



